import React from "react";

function Two(){
    return(
        <>
            <div style={{position:"absolute",top:"calc(50% - 7.5px)",left:"calc(35% - 7.5px)"}} 
                className="point-dadosa bg-dark rounded-circle">
                </div>    
                <div style={{position:"absolute",top:"calc(50% - 7.5px)",right:"calc(35% - 7.5px)"}} 
                    className="point-dadosa bg-dark rounded-circle">
            </div>
        </>
    )
}

export default Two;
